import React, { Component } from "react";

export class SingIn extends Component {
  render() {
    return (
      <div className="container">
        <div className="Siin">
          <form>
            <span>Pseudo</span>
            <input />
            <span>Mail</span>
            <input />
            <span>Mot de passe</span>
            <input />
            <button>Envoyer</button>
          </form>
        </div>
      </div>
    );
  }
}

export default SingIn;
